import React, { Component } from "react";
import Container from "react-bootstrap/Container";
import Card from "react-bootstrap/Card";
import FormInput from "./cost";

class Cost extends Component {
  state = {};
  render() {
    return (
      <div>
        <Container
          style={{
            alignitems: "center",
            textAlign: "left",
            fontWeight: "bold",
            color: "blue",
          }}
        >
          <Card>
            <Card.Body>
              <h1> Hi </h1>
            </Card.Body>
          </Card>
        </Container>
      </div>
    );
  }
}

export default Cost;
